import{_ as e,a,b as l,c as r,d as i}from"./chunks/cuav_v5_debug_cable.BWgMAv7P.js";import{_ as n,c as d,a8 as o,o as h}from"./chunks/framework.BDnHobkS.js";const m=JSON.parse('{"title":"Порт для налагодження SWD","description":"","frontmatter":{},"headers":[],"relativePath":"uk/debug/swd_debug.md","filePath":"uk/debug/swd_debug.md"}'),s={name:"uk/debug/swd_debug.md"};function g(p,t,u,b,f,x){return h(),d("div",null,t[0]||(t[0]=[o('<h1 id="порт-для-налагодження-swd" tabindex="-1">Порт для налагодження SWD <a class="header-anchor" href="#порт-для-налагодження-swd" aria-label="Permalink to &quot;Порт для налагодження SWD&quot;">​</a></h1><p>PX4 runs on ARM Cortex-M microcontrollers, which contain dedicated hardware for interactive debugging via the <a href="https://developer.arm.com/documentation/ihi0031/a/The-Serial-Wire-Debug-Port--SW-DP-" target="_blank" rel="noreferrer"><em>Serial Wire Debug (SWD)</em></a> interface and non-invasive profiling and high-bandwidth tracing via the <a href="https://developer.arm.com/documentation/ddi0403/d/Appendices/Debug-ITM-and-DWT-Packet-Protocol?lang=en" target="_blank" rel="noreferrer"><em>Serial Wire Ouput (SWO)</em></a> and <a href="https://developer.arm.com/documentation/ihi0064/latest/" target="_blank" rel="noreferrer"><em>TRACE</em> pins</a>.</p><p>Інтерфейс відладки SWD дозволяє прямий, низькорівневий, апаратний доступ до процесора мікроконтролера та периферійних пристроїв, тому він не залежить від будь-якого програмного забезпечення на пристрої. Отже, його можна використовувати для налагодження завантажувальних програм та операційних систем, таких як NuttX.</p><h2 id="налагодження-сигналів" tabindex="-1">Налагодження сигналів <a class="header-anchor" href="#налагодження-сигналів" aria-label="Permalink to &quot;Налагодження сигналів&quot;">​</a></h2><p>Чотири сигнали необхідні для відлагодження (в жирному шрифті), а решту лише рекомендується.</p><table tabindex="0"><thead><tr><th style="text-align:left;">Назва</th><th style="text-align:left;">Тип</th><th style="text-align:left;">Опис</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>GND</strong></td><td style="text-align:left;">Power</td><td style="text-align:left;">Спільний потенціал, спільна основа.</td></tr><tr><td style="text-align:left;"><strong>VREF</strong></td><td style="text-align:left;">Power</td><td style="text-align:left;">Цільове довідкове напруга дозволяє засоби налагодження використовувати рівнеміри на сигнали.</td></tr><tr><td style="text-align:left;"><strong>SWDIO</strong></td><td style="text-align:left;">I/O</td><td style="text-align:left;">Пін даних для послідовного знавантаження через мережу.</td></tr><tr><td style="text-align:left;"><strong>SWCLK</strong></td><td style="text-align:left;">Вхід</td><td style="text-align:left;">Пін годинника для послідовного знавантаження через мережу.</td></tr><tr><td style="text-align:left;">nRST</td><td style="text-align:left;">Вхід</td><td style="text-align:left;">PIN скидання є необов’язковим (n = активним низьким).</td></tr><tr><td style="text-align:left;">SWO</td><td style="text-align:left;">Output</td><td style="text-align:left;">Однопровідний шлейф асинхронних даних з можливістю виведення даних ITM та DWT.</td></tr><tr><td style="text-align:left;">TRACECK</td><td style="text-align:left;">Output</td><td style="text-align:left;">Трасування годинника для паралельної шини.</td></tr><tr><td style="text-align:left;">TRACED[0-3]</td><td style="text-align:left;">Output</td><td style="text-align:left;">Трасування синхронної шини даних з 1, 2 чи 4 бітами.</td></tr></tbody></table><p>Пін скидання апаратного забезпечення є необов&#39;язковим, оскільки більшість пристроїв також можуть бути скинуті через лінії SWD. Однак швидке скидання пристрою за допомогою кнопки може бути великим плюсом для розробки.</p><p>SWO-пін може випромінювати дані профілювання в реальному часі з наносекундним відмітками часу, тому настійно рекомендується мати доступ до нього для відлагодження.</p><p>Піни TRACE потребують спеціалізованих засобів відлагодження для роботи з високою пропускною здатністю та наступним декодуванням потоку даних. Зазвичай вони недоступні і зазвичай використовуються лише для відлагодження дуже конкретних питань з часом.</p><p><a id="debug-ports"></a></p><h2 id="порти-налагодження-автопілота" tabindex="-1">Порти налагодження автопілота <a class="header-anchor" href="#порти-налагодження-автопілота" aria-label="Permalink to &quot;Порти налагодження автопілота&quot;">​</a></h2><p>Flight controllers commonly provide a single debug port that exposes both the <a href="#debug-signals">SWD Interface</a> and <a href="./system_console.html">System Console</a>.</p><p>The <a href="#pixhawk-standard-debug-ports">Pixhawk Connector Standards</a> formalize the port that must be used in each FMU version. However there are still many boards that use different pinouts or connectors, so we recommend you check the <a href="./../flight_controller/">documentation for your autopilot</a> to confirm port location and pinout.</p><p>Місцезнаходження порту налагодження та роз&#39;єми для підмножини автопілотів зв&#39;язані нижче:</p><p><a id="port-information"></a></p><table tabindex="0"><thead><tr><th style="text-align:left;">Автопілот</th><th style="text-align:left;">Відладочний порт</th></tr></thead><tbody><tr><td style="text-align:left;">Holybro Pixhawk 6X-RT (FMUv6X-RT)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">Holybro Pixhawk 6X (FMUv6x)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">Holybro Pixhawk 5X (FMUv5x)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/durandal.html#debug-port">Holybro Durandal</a></td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/kakutef7.html#debug-port">Holybro Kakute F7</a></td><td style="text-align:left;">Паяльні майданчики</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk4_mini.html#debug-port">Holybro Pixhawk 4 Mini</a> (FMUv5)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk4.html#debug_port">Holybro Pixhawk 4</a> (FMUv5)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk3_pro.html#debug-port">Drotek Pixhawk 3 Pro</a> (FMU-v4pro)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_plus.html#debug-port">CUAV V5+</a></td><td style="text-align:left;">6-pin JST GH<br>Digikey: <a href="https://www.digikey.com/products/en?keywords=455-1582-1-ND" target="_blank" rel="noreferrer">BM06B-GHS-TBT(LF)(SN)(N)</a> (vertical mount), <a href="https://www.digikey.com/products/en?keywords=455-1568-1-ND" target="_blank" rel="noreferrer">SM06B-GHS-TBT(LF)(SN)(N)</a> (side mount)</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#debug_port">CUAV V5nano</a></td><td style="text-align:left;">6-pin JST GH<br>Digikey: <a href="https://www.digikey.com/products/en?keywords=455-1582-1-ND" target="_blank" rel="noreferrer">BM06B-GHS-TBT(LF)(SN)(N)</a> (vertical mount), <a href="https://www.digikey.com/products/en?keywords=455-1568-1-ND" target="_blank" rel="noreferrer">SM06B-GHS-TBT(LF)(SN)(N)</a> (side mount)</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk.html#swd-port">3DR Pixhawk</a></td><td style="text-align:left;">ARM 10-pin JTAG Connector (also used for FMUv2 boards including: <em>mRo Pixhawk</em>, <em>HobbyKing HKPilot32</em>).</td></tr></tbody></table><p><a id="pixhawk-standard-debug-ports"></a></p><h2 id="стандарт-роз-ємів-pixhawk-debug-портів" tabindex="-1">Стандарт роз&#39;ємів Pixhawk Debug Портів <a class="header-anchor" href="#стандарт-роз-ємів-pixhawk-debug-портів" aria-label="Permalink to &quot;Стандарт роз&#39;ємів Pixhawk Debug Портів&quot;">​</a></h2><p>Проект Pixhawk визначив стандартну схему виводів та тип роз&#39;єму для різних випусків Pixhawk FMU:</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Check your <a href="#port-information">specific board</a> to confirm the port used.</p></div><table tabindex="0"><thead><tr><th style="text-align:left;">Версія FMU</th><th style="text-align:left;">Версія Pixhawk</th><th style="text-align:left;">Відладочний порт</th></tr></thead><tbody><tr><td style="text-align:left;">FMUv2</td><td style="text-align:left;"><a href="./../flight_controller/pixhawk.html#swd-port">Pixhawk / Pixhawk 1</a></td><td style="text-align:left;">10 pin ARM Debug</td></tr><tr><td style="text-align:left;">FMUv3</td><td style="text-align:left;">Pixhawk 2</td><td style="text-align:left;">6 pin SUR Debug</td></tr><tr><td style="text-align:left;">FMUv4</td><td style="text-align:left;">Pixhawk 3</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;">FMUv5</td><td style="text-align:left;">Pixhawk 4 FMUv5</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;">FMUv5X</td><td style="text-align:left;">Pixhawk 5X</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6</td><td style="text-align:left;">Pixhawk 6</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6X</td><td style="text-align:left;">Pixhawk 6X</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6X-RT</td><td style="text-align:left;">Pixhawk 6X-RT</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>There FMU and Pixhawk versions are (only) consistent after FMUv5X.</p></div><h3 id="pixhawk-debug-mini" tabindex="-1">Pixhawk Debug Mini <a class="header-anchor" href="#pixhawk-debug-mini" aria-label="Permalink to &quot;Pixhawk Debug Mini&quot;">​</a></h3><p>The <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> defines the <em>Pixhawk Debug Mini</em>, a <em>6-Pin SH Debug Port</em> that provides access to both SWD pins and the <a href="./system_console.html">System Console</a>.</p><p>Це використовується в FMUv4 та FMUv5.</p><p>Схема виводів показана нижче (виводи, необхідні для налагодження, виділені жирним шрифтом):</p><table tabindex="0"><thead><tr><th style="text-align:right;">Pin</th><th style="text-align:left;">Сигнал</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;"><strong>VREF</strong></td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">Console TX</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">Console RX</td></tr><tr><td style="text-align:right;">4</td><td style="text-align:left;"><strong>SWDIO</strong></td></tr><tr><td style="text-align:right;">5</td><td style="text-align:left;"><strong>SWDCLK</strong></td></tr><tr><td style="text-align:right;">6</td><td style="text-align:left;"><strong>GND</strong></td></tr></tbody></table><p>Визначення порту налагодження містить наступні припояні пластины (на платі поряд із роз&#39;ємом):</p><table tabindex="0"><thead><tr><th style="text-align:right;">Pad</th><th style="text-align:left;">Сигнал</th><th style="text-align:left;">Напруга</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;">nRST</td><td style="text-align:left;">+3.3V</td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">GPIO1</td><td style="text-align:left;">+3.3V</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">GPIO2</td><td style="text-align:left;">+3.3V</td></tr></tbody></table><p>The socket is a <em>6-pin JST SH</em> - Digikey number: <a href="https://www.digikey.com/products/en?keywords=455-2875-1-ND" target="_blank" rel="noreferrer">BM06B-SRSS-TBT(LF)(SN)</a> (vertical mount), <a href="https://www.digikey.com/products/en?keywords=455-1806-1-ND" target="_blank" rel="noreferrer">SM06B-SRSS-TBT(LF)(SN)</a>(side mount).</p><p>You can connect to the debug port using a <a href="https://www.digikey.com/products/en?keywords=A06SR06SR30K152A" target="_blank" rel="noreferrer">cable like this one</a>.</p><p><img src="'+e+'" alt="6-pin JST SH Cable"></p><h3 id="порти-відладки-pixhawk-full" tabindex="-1">Порти відладки Pixhawk Full <a class="header-anchor" href="#порти-відладки-pixhawk-full" aria-label="Permalink to &quot;Порти відладки Pixhawk Full&quot;">​</a></h3><p>The <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> defines <em>Pixhawk Debug Full</em>, a <em>10-Pin SH Debug Port</em> that provides access to both SWD pins and the <a href="./system_console.html">System Console</a>. This essentially moves the solder pads from beside the <a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a> into the connector, and also adds an SWO pin.</p><p>Цей порт вказаний для використання в FMUv5x, FMUv6, FMUv6x.</p><p>Схема виводів показана нижче (виводи, необхідні для налагодження, виділені жирним шрифтом):</p><table tabindex="0"><thead><tr><th style="text-align:right;">Pin</th><th style="text-align:left;">Сигнал</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;"><strong>VREF</strong></td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">Console TX</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">Console RX</td></tr><tr><td style="text-align:right;">4</td><td style="text-align:left;"><strong>SWDIO</strong></td></tr><tr><td style="text-align:right;">5</td><td style="text-align:left;"><strong>SWDCLK</strong></td></tr><tr><td style="text-align:right;">6</td><td style="text-align:left;">SWO</td></tr><tr><td style="text-align:right;">7</td><td style="text-align:left;">GPIO1</td></tr><tr><td style="text-align:right;">8</td><td style="text-align:left;">GPIO2</td></tr><tr><td style="text-align:right;">9</td><td style="text-align:left;">nRST</td></tr><tr><td style="text-align:right;">10</td><td style="text-align:left;"><strong>GND</strong></td></tr></tbody></table><p>Піни GPIO1/2 є вільними пінами, які можуть бути використані для генерації сигналів у програмному забезпеченні для аналізу часу з логічним аналізатором.</p><p>The socket is a <em>10-pin JST SH</em> - Digikey number: <a href="https://www.digikey.com/products/en?keywords=455-1796-2-ND" target="_blank" rel="noreferrer">BM10B-SRSS-TB(LF)(SN)</a> (vertical mount) or <a href="https://www.digikey.com/products/en?keywords=455-1810-2-ND" target="_blank" rel="noreferrer">SM10B-SRSS-TB(LF)(SN)</a> (side mount).</p><p>You can connect to the debug port using a <a href="https://www.digikey.com/products/en?keywords=A10SR10SR30K203A" target="_blank" rel="noreferrer">cable like this one</a>.</p><p><img src="'+a+'" alt="10-pin JST SH Cable"></p><p><a id="debug-probes"></a></p><h2 id="зонди-налагодження-для-апаратного-забезпечення-px4" tabindex="-1">Зонди налагодження для апаратного забезпечення PX4 <a class="header-anchor" href="#зонди-налагодження-для-апаратного-забезпечення-px4" aria-label="Permalink to &quot;Зонди налагодження для апаратного забезпечення PX4&quot;">​</a></h2><p>Flight controllers commonly provide a <a href="#autopilot-debug-ports">single debug port</a> that exposes both the <a href="#debug-signals">SWD Interface</a> and <a href="./system_console.html">System Console</a>.</p><p>Є кілька зондів відлагодження, які були перевірені та підтримуються для підключення до одного або обох цих інтерфейсів:</p><ul><li><a href="./../debug/probe_jlink.html">SEGGER J-Link</a>: commercial probe, no built-in serial console, requires adapter.</li><li><a href="./../debug/probe_bmp.html">Black Magic Probe</a>: integrated GDB server and serial console, requires adapter.</li><li><a href="./../debug/probe_stlink.html">STLink</a>: best value, integrated serial console, adapter must be soldered.</li><li><a href="./../debug/probe_mculink.html">MCU-Link</a>: best value, integrated serial console, requires adapter.</li></ul><p>Адаптер для підключення до роз&#39;єму відладки може поставлятися разом із вашим контролером польоту або відлагоджувальним зондом. Інші варіанти наведено нижче.</p><h2 id="адаптери-для-відлагоджування" tabindex="-1">Адаптери для відлагоджування <a class="header-anchor" href="#адаптери-для-відлагоджування" aria-label="Permalink to &quot;Адаптери для відлагоджування&quot;">​</a></h2><h3 id="адаптер-відлагодження-holybro-pixhawk" tabindex="-1">Адаптер відлагодження Holybro Pixhawk <a class="header-anchor" href="#адаптер-відлагодження-holybro-pixhawk" aria-label="Permalink to &quot;Адаптер відлагодження Holybro Pixhawk&quot;">​</a></h3><p>The <a href="https://holybro.com/products/pixhawk-debug-adapter" target="_blank" rel="noreferrer">Holybro Pixhawk Debug Adapter</a> is <em>highly recommended</em> when debugging controllers that use one of the Pixhawk-standard debug connectors.</p><p>Це найлегший спосіб підключення:</p><ul><li>Flight controllers that use either the <a href="#pixhawk-debug-full">Pixhawk Debug Full</a> (10-pin SH) or <a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a> (6-pin SH) debug port.</li><li>SWD debug probes that support the 10-pin ARM compatible interface standard used by the <a href="./../debug/probe_jlink.html">Segger JLink EDU mini</a> or 20-pin compatible with the Segger JLink or STLink.</li></ul><p><img src="'+l+'" alt="Holybro Pixhawk Debug Adapter"></p><h3 id="адаптер-відлагодження-cuav-c-adb-pixhawk" tabindex="-1">Адаптер відлагодження CUAV C-ADB Pixhawk <a class="header-anchor" href="#адаптер-відлагодження-cuav-c-adb-pixhawk" aria-label="Permalink to &quot;Адаптер відлагодження CUAV C-ADB Pixhawk&quot;">​</a></h3><p>The <a href="https://store.cuav.net/shop/cuav-c-adb/" target="_blank" rel="noreferrer">CUAV C-ADB Secondary Development Pixhawk Flight Controller Debug Adapter</a> comes with an <a href="./../debug/probe_stlink.html">STLinkv3-MINIE Debug Probe</a>.</p><p>This has a ports for connecting to the <a href="#pixhawk-debug-full">Pixhawk Debug Full</a> (10-pin SH) and CUAV-standard DSU interface (but not the <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> (6-pin SH)).</p><p>The M2 connector on the adaptor is 14-pin CN4 STDC14 (see the <a href="https://www.st.com/resource/en/user_manual/um2910-stlinkv3minie-debuggerprogrammer-tiny-probe-for-stm32-microcontrollers-stmicroelectronics.pdf" target="_blank" rel="noreferrer">STLinkv3-MINIE User Manual</a> for more information). Кабель, який використовується для підключення M2 та STLinkv3-MINIE, постачається з адаптером.</p><p><img src="'+r+'" alt="CUAV C-ADB adaptor connected to the STLinkv3-MINIE"></p><h3 id="адаптери-для-відлагоджування-1" tabindex="-1">Адаптери для відлагоджування <a class="header-anchor" href="#адаптери-для-відлагоджування-1" aria-label="Permalink to &quot;Адаптери для відлагоджування&quot;">​</a></h3><p>Some SWD <a href="#debug-probes">debug probes</a> come with adapters/cables for connecting to common Pixhawk <a href="#debug-ports">debug ports</a>. Зонди, про які відомо, що поставляються з роз&#39;ємами, перераховані нижче:</p><ul><li><a href="./../debug/probe_bmp.html#dronecode-probe">DroneCode Probe</a>: comes with a connector for attaching to the <a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></li></ul><h3 id="адаптери-специфічні-для-плати" tabindex="-1">Адаптери, специфічні для плати <a class="header-anchor" href="#адаптери-специфічні-для-плати" aria-label="Permalink to &quot;Адаптери, специфічні для плати&quot;">​</a></h3><p>Some manufacturers provide cables to make it easy to connect the SWD interface and <a href="./../debug/system_console.html">System Console</a>.</p><ul><li><a href="./../flight_controller/cuav_v5_nano.html#debug_port">CUAV V5nano</a> and <a href="./../flight_controller/cuav_v5_plus.html#debug-port">CUAV V5+</a> include this debug cable:</li></ul><p><img src="'+i+'" alt="6-pin JST SH Cable"></p><h3 id="користувацькі-кабелі" tabindex="-1">Користувацькі кабелі <a class="header-anchor" href="#користувацькі-кабелі" aria-label="Permalink to &quot;Користувацькі кабелі&quot;">​</a></h3><p>Ви також можете створити власні кабелі для підключення до різних плат або зондів:</p><ul><li>Connect <code>SWDIO</code>, <code>SWCLK</code> and <code>GND</code> pins on the debug probe to the corresponding pins on the debug port.</li><li>Підключіть контакт VREF, якщо його підтримує засіб відлагодження.</li><li>Підключіть залишкові контакти, якщо вони є.</li></ul><p>See the <a href="./probe_stlink.html">STLinkv3-MINIE</a> for a guide on how to solder a custom cable.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Where possible, we highly recommend that you create or obtain an adapter board rather than custom cables for connecting to SWD/JTAG debuggers and computers. Це зменшує ризик неправильного підключення проводів, що призводить до проблем з налагодженням, і має перевагу в тому, що адаптери зазвичай надають спільний інтерфейс для підключення до кількох популярних плат керування польотом.</p></div>',70)]))}const k=n(s,[["render",g]]);export{m as __pageData,k as default};
